import React from 'react';
import Header from './Header';
import Footer from "./Footer";
import Note from "./Note";
import notes from "./notes";

function createNoteItem(newItem) {
    return <note
            title ={newItem.title}
            content ={newItem.content}
        />
}

function App() {
    return(
    <div>
      <Header />
        {notes.map(createNoteItem)}
      <Footer />
    </div>
    );
}

export default App;
